import Svg from "./svg";
import { motion } from "framer-motion";

const Header = (props) => {
  return (
    <header>
      <div className="overlay" />
      <video
        playsInline="playsinline"
        autoPlay="autoplay"
        muted="muted"
        loop="loop"
      >
        <source src={require(props.videoLink)} type="video/mp4" />
      </video>
      <div className="container h-100">
        <div className="d-flex h-100 text-center align-items-center">
          <div className="w-100 text-white">
            <header className="page-header">
              <div className="page-header-content">
                <div className="container text-center">
                  <div className="row justify-content-center">
                    <motion.div
                      initial="hidden"
                      animate="visible"
                      className="col-lg-8"
                      variants={{
                        hidden: {
                          scale: 0.8,
                          opacity: 0,
                        },
                        visible: {
                          scale: 1,
                          opacity: 1,
                          transition: {
                            delay: 0.4,
                          },
                        },
                      }}
                    >
                      <h1 className="page-header-title mb-3 text-white title">
                        ShopAR
                      </h1>
                      <h2 className="text-white mb-0 subtitle">
                        Â¡Selecciona tu tienda favorita <br></br> y comienza a
                        experimentar la realidad aumentada!
                      </h2>
                    </motion.div>
                  </div>
                </div>
              </div>
            </header>
          </div>
        </div>
      </div>
      <Svg />
    </header>
  );
};

export default Header;
